message:
NOVO - A Reserva Estratégica de Petróleo dos EUA foi drenada pela 60ª semana consecutiva para seu nível mais baixo desde 1984. 

O declínio de 33% este ano é o maior já registrado. 

@disclosetv

NOVO - O primeiro-ministro britânico Rishi Sunak sai do palco e é levado para fora da sala por assessores na cúpula da COP27 no Egito. 

Um dos assessores de Sunak podia ser visto sussurrando em seu ouvido enquanto ele estava no palco - o primeiro-ministro saiu da sala logo depois. 

@disclosetv
